import React from "react";
import Box from "@mui/material/Box";
export const Login = () => {
  const style = {
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%, -50%)",
    width: 400,
    bgcolor: "#ffffff",
    boxShadow: 24,
    p: 4,
    outline: 0,
  };
  return <Box sx={style}>Hey</Box>;
};
